                <iframe className='googleMap'
                        src="https://www.google.com/maps/embed/v1/place?q=place_id:ChIJHazaZOXjDDkRVsV7DjQuWCw&amp;key=AIzaSyBRBQG98E5YdUoooyAk2wd-_olpWmL5ACE"
                        >
                </iframe>
                    </div>
            <Footer></Footer>
        </div>
    );
}

export default Contact;
